INSERT INTO `info_adicional` (`id_info_adicional`, `resumen`, `problema`, `justificacion`, `resultados`, `conclusion`, `estudiante_id_estudiante`, `objetivo_g`, `objetivo_e`, `calificacion`, `observacion`, `fecha`) VALUES
(1, 'El Plan Nacional de Alfabetizacion y Formacion Tecnologica es una iniciativa de formacion\r\nsociotecnologica, con la mision de lograr la formacion basica de las comunidades en el uso\r\nde las nuevas tecnologıas de informacion y comunicacion (TIC), promoviendo el uso del\r\ncomputador como herramienta que facilita las acciones del poder popular.\r\nLa formacion consiste en un conjunto de modulos gratuitos de corta duracion que orientan\r\nal participante al uso y manejo de un computador en paquetes de ofimatica e internet, bajo\r\nel ambiente de Software Libre.\r\nDurante un periodo de 120 horas como lo establece las leyes vigentes para el Servi-\r\ncio Comunitario, se impartieron clases en talleres de formacion tecnologica, en este caso,\r\nespecıficamente en la Fundacion Infocentro de Santa In ́es ubicado en la parroquia Rafael\r\nUrdaneta, municipio Valencia del estado Carabobo. con el fin de beneficiar a esta comunidad\r\nen particular en el  ́area de la tecnologıa a traves de los talleres de formacion tecnologica.', 'En la actualidad, queramos o no, la tecnologıa ya es parte del dıa a dıa a tal manera que\r\ndependemos de la misma. pero por otra parte nos facilitad hacer muchas cosas que de otra\r\nmanera pudieran ser imposibles, y entre ellas se encuentra la educacion.\r\nLas zonas remotas y/o zonas no allegadas al centro de la ciudad, no cuenta con todos los\r\nbeneficios o servicios publicos y privados que se prestan en las grandes ciudades, las pequenas\r\ncomunidades generalmente estan algo atrasadas en materias de tecnologıa y en un mundo en\r\ndonde todo es tecnologico, esto puede representar un problema o una limitacion a la hora de\r\noptar por una mejor calidad de vida o simplemente tener una mejor educacion.\r\nla problematica consiste precisamente, en la carencia de conocimientos por los miembros\r\nde la comunidad de Santa In ́es y comunidades allegadas sobre el  ́area de la tecnologıa, ya que\r\nen las zonas anteriormente mencionadas, no se cuenta con el servicio de Internet y la mayor ́ıa\r\nde la poblacion no cuenta con los recursos necesarios para optar por una computadora.\r\nEs as ́ı, en medio de esta necesidad, que el Departamento de Computacion, de la Facultad\r\nExperimental de Ciencias y Tecnologıa de la Universidad de Carabobo, en conjunto con la\r\nFundacion Infocentro del estado Carabobo, trabajan de forma colaborativa para combatir\r\nesta necesidad mediante el dictado de talleres de formacion tecnologica.', 'Enmarcado en el Proyecto de Servicio Comunitario del Departamento de Computacion\r\nde la Facultad de Ciencias y Tecnologıa de la Universidad de Carabobo titulado:\r\n“Servicio Comunitario Infocentros Edo. Carabobo”\r\nCuyo proposito es la del adiestramiento de las comunidades en el Plan Nacional de Formacion Tecnologica. se ha llevado la primera fase que es establecer contactos con el consejo\r\ncomunal, en este caso de la comunidad de Santa In ́es ubicado al sur de valencia.\r\nLa justificacion de este proyecto es notoria al observar la falta de conocimientos en el  area\r\ntecnologica por parte de los miembros de la comunidad de Santa In ́es, la cual debido a su\r\nlocalizacion no cuenta con el servicio de Internet adecuado, lo que dificultad su contacto con\r\nla tecnologıa.', 'Los resultados obtenidos al dictar las clases de forma teorica y practica fueron exitosos\r\ncomo lo fueron previsto. Al comenzar las clases abordando la teorıa y luego terminar generalmente con una actividad practica, los integrantes de los talleres de formacion mostraban\r\ngran inter ́es en terminar las actividades, de hecho, en muchas ocasiones se quedaban al fina-\r\nlizar las clases para terminar la actividad, o como en otras ocasiones distintas, llegaban mas\r\ntemprano al dıa siguiente para terminar la actividad practica asignada la clase anterior.\r\nAl comienzo de los modulos generalmente la parte teorica abarcaba mas que la parte\r\npractica, pero a medida que se avanzaba con los manuales se incrementaba mas la parte\r\npractica, al punto de haber netamente practicas. generalmente estas clases eran clases de\r\nrepaso de algun punto especifico, o de un modulo completo, estos repaso eran tanto exigidos\r\npor los integrantes como tambien dictados de forma obligatoria al observar que no existıa un\r\ndominio sobre los puntos explicados.\r\nGracias a esta flexibilidad en las clases que se dictaban seg ́\r\nun la necesidades de los integrantes, se pudo obtener un resultado exitoso, al ver y observar como los integrantes de los\r\ntalleres mostraron dominio sobres los puntos explicados.', 'Culminada la labor prestada en el Infocentro de Santa In ́es, es de gran orgullo y satisfaccion propia, el ver a los miembros de los talleres alcanzar un dominio sobre los topicos\r\ndictados en los talleres de formacion, la gran participacion durante todo el taller de forma-\r\ncion, y el ver la gran muestra de interes por los miembros de la comunidad en inscribirse el los\r\ncursos de computacion ofertado en el centro. de hecho, algunos integrantes que terminaron\r\nel primer curso de computacion basica mostraron interes en continuar su aprendizaje con los\r\ncursos avanzados.\r\nEn definitiva, es posible decir que los objetivos planteados en el proyecto fueron alcanzados\r\nde forma exitosa. el taller de formacion dictado en el Infocentro de Santa In ́es tuvo gran\r\nimpacto en la comunidad, lo que con seguridad generara mayor participacion por lo miembros\r\nde la comunidad en los proximos talleres de formacion tecnologica.', 2, 'Hacer llegar a los miembros de la comunidad de Santa In ́es y comunidades allegadas, la\r\ntecnologıa a sus manos hablando especıficamente del uso de los computadores y la Internet.\r\nAdemas, de prestar el servicio al cliente en el Infocentro de Santa In ́es la labor principal es\r\nla de impartir los conocimientos de como hacer un uso correcto de los computadores a traves\r\nde los talleres de formacion.', 'Capacitar a los integrantes de los talleres en los siguientes puntos      \r\n\r\n1. Desarrollo de habilidades y destrezas en el uso del computador\r\n\r\n2. Elaborar documentos utilizando las funcionalidades del procesador de palabras Writer\r\n\r\n3. Elaborar presentaciones creativas utilizando las funcionalidades del gestor de presentaciones (Impress) para mejorar los procesos desarrollados en la vida cotidiana y en la\r\ncomunidad\r\n\r\n4. Emplear la Hoja de Calculo (Calc) para organizar y graficar datos que faciliten las\r\ntareas cotidianas y el trabajo comunitario\r\n\r\n5. Manejar herramientas de busquedas y navegacion en Internet para la obtencion de\r\ninformacion electronica al instante\r\n\r\n6. Aplicar los servicios de comunicacion de Internet como apoyo en el desarrollo de actividades cotidianas y el trabajo comunitario', 'por evaluar', NULL, '2016-02-25'),
