INSERT INTO `proyecto` (`id_proyecto`, `nombre`, `fecha_inicio`, `fecha_fin`, `locacion`, `instituto`, `instituto_propone`, `justificacion`, `periodo`, `departamento`, `fecha_desco`, `descripcion`, `estatus`) VALUES
(1, 'Alfabetización Tecnológica a las  Comunidades del Estado Carabobo Utilizando Software Libre  (Sistema Operativo Canaima)', '2013-11-07', '2017-10-20', 'Carabobo', 'interno', 'Universidad de Carabobo', 'El software libre ha tenido un crecimiento significativo en Venezuela, y\r\nsu utilización ha sido vital para el desarrollo tecnológico del país, esto resulta\r\nmuy importante, ya que esta generación ha sido testigo del avance\r\nexponencial que ha sufrido la tecnología, específicamente los sistemas de\r\ninformación en el mundo. La evolución de dichos sistemas ha permitido un\r\nprogreso que ha impulsado el desempeño de las actividades cotidianas de\r\ncualquier tipo de persona.\r\nEn este sentido, FUNDACITE surge en respuesta a la necesidad\r\nfundamental de lograr el desarrollo integral de Carabobo, mediante el uso de\r\nherramientas científicas y tecnológicas que promuevan y fortalezcan la\r\ninvestigación aplicada para beneficio de la sociedad, con esta idea, y con la\r\nayuda la Facultad Experimental de Ciencia y Tecnología de la Universidad de\r\nCarabobo se ha detectado la necesidad de impartir conocimientos\r\ntecnológicos a las comunidades del Estado Carabobo, de modo que sean\r\nautosustentables para su crecimiento intelectual y recíprocamente tengan un\r\nimpacto en el desarrollo tecnológico del Estado.\r\nPuntualmente se manifestó la necesidad de realizar talleres de\r\nalfabetización y formación tecnológica en tres (3) escuelas, a saber: Escuela\r\nBásica Güere, Escuela Bolivariana “Montalbán” y Escuela Nacional Raúl\r\nLeoni, ya que en ellas los estudiantes reflejaban un bajo conocimiento sobre\r\nla importancia del software libre en el país, de igual manera los estudiantes\r\nno poseían un conocimiento básico de las herramientas que ofrecía el \r\n6\r\nsistema operativo Canaima, ni tenían noción sobre el debido cuidado que se\r\nles debe tener a las computadoras. En la mayoría de los casos, se observó\r\nque los estudiantes no poseen computadoras de escritorio en sus casas, y\r\nlos que sí las poseen no cuentan con sistemas operativos basados en\r\nsoftware libre; los estudiantes sólo contaban con las Canaimitas como\r\nherramienta de desarrollo informático, y en muchos casos estas\r\ncomputadoras no estaban operativas debido al mal uso o poco cuidado que\r\nse les había dado por parte de sus propietarios.\r\nDebido a las razones ya mencionadas, surge la necesidad de realizar\r\nun diagnóstico de las Canaimitas operativas y no operativas, y de los\r\ncolegios, con la finalidad de detectar qué computadoras se podían reparar\r\npara que el desarrollo de los cursos de alfabetización y formación tecnológica\r\nse dieran de manera efectiva y de esta manera cumplir con las escuelas,\r\ndejándoles el conocimiento a los estudiantes y docentes. Quienes se\r\nencargarán de seguir impartiendo el conocimiento, y que las necesidades\r\neducativas e intelectuales de la comunidad queden satisfechas por mucho\r\nmás tiempo.\r\nLos directivos de las escuelas a las cuales visitamos plantearon la\r\nnecesidad de realizar una jornada de actualización del sistema de las\r\nCanaimitas, de manera que se recuperasen las computadoras no operativas,\r\nluego, recibir el taller de alfabetización tecnológica a nivel estudiantil y\r\ndocente en todos los grados y en todas las secciones, además se planteó la\r\nidea de hacer llegar el taller a los representantes. En particular, la Escuela\r\nNacional Raúl Leoni y la Escuela Bolivariana “Montalbán” no contaban con\r\ncomputadoras para los alumnos de 1ro y 2do grado, por lo que no se\r\ncontemplaron en el plan de alfabetización.\r\nDespués de realizar el planteamiento del problema e identificar cada\r\nuno de los objetivos a cumplir, pudimos construir la lista de problemas, la\r\nidentificación de la causa crítica, el árbol objetivo, y como tal la definición del \r\n7\r\nproblema. Todos estos datos se verán reflejados al final de este informe en el\r\napartado de anexo.', '2016-1', 'Computación', '2013-10-17', 'La Facultad Experimental de Ciencias y Tecnología de la Universidad\r\nde Carabobo, la Unidad Territorial Carabobo (FUNDACITE) y los Infocentros\r\ndel Estado se han unido para combatir las necesidades de alfabetización\r\ntecnológica en distintas comunidades, por lo cual, se ha planteado la\r\nutilización del Plan Nacional de Alfabetización y Formación Tecnológica de\r\nlos Infocentros para asistir a las comunidades de manera directa.\r\nCon el propósito de cumplir con la necesidad de alfabetización, se dio\r\nvisita a varias escuelas en el municipio de Naguanagua, de esas escuelas\r\ndestacan la Escuela Básica Güere, la Escuela Bolivariana “Montalbán” y la\r\nEscuela Nacional Raúl Leoni. En estas escuelas se hizo un diagnóstico de\r\nlas necesidades básicas de la población estudiantil con respecto a las\r\nCanaimitas, computadoras que se usaron como herramientas de aprendizaje\r\na lo largo del proyecto, se procedió a satisfacer las necesidades\r\nencontradas, para luego poder impartir los cursos de alfabetiz', 'inactivo');
